$0(){return this.a.mw("CGU \u2013 Comptes & s\xe9curit\xe9\n\n1. Cr\xe9ation de compte\nCertaines fonctionnalit\xe9s (publication, messagerie, r\xe9ponses) n\xe9cessitent la cr\xe9ation d\u2019un compte. L\u2019utilisateur s\u2019engage \xe0 fournir des informations exactes, \xe0 jour et \xe0 ne pas usurper l\u2019identit\xe9 d\u2019un tiers.\n\n2. Responsabilit\xe9 de l\u2019utilisateur\nL\u2019utilisateur est responsable :\n\u2022 de la confidentialit\xe9 de ses identifiants,\n\u2022 de l\u2019usage de son compte,\n\u2022 des actions r\xe9alis\xe9es via son compte, y compris en cas de perte/vol si aucune mesure n\u2019a \xe9t\xe9 prise (changement de mot de passe, d\xe9connexion, etc.).\n\nEn cas de suspicion d\u2019acc\xe8s non autoris\xe9, l\u2019utilisateur doit contacter l\u2019\xc9diteur \xe0 contact@ilipresto.fr dans les meilleurs d\xe9lais.\n\n3. S\xe9curit\xe9 et lutte contre les abus\nAfin de prot\xe9ger la Plateforme et les utilisateurs, l\u2019\xc9diteur peut mettre en place des mesures de s\xe9curit\xe9 (contr\xf4les, limitation, d\xe9tection d\u2019abus, mod\xe9ration, blocage, etc.).\nToute tentative de fraude, contournement, intrusion, extraction automatis\xe9e des donn\xe9es (scraping), ou attaque contre la Plateforme est strictement interdite.\n\n4. Suspension / suppression de compte\nL\u2019\xc9diteur se r\xe9serve le droit de suspendre ou supprimer un compte, sans pr\xe9avis, en cas notamment :\n\u2022 de non-respect des CGU,\n\u2022 de comportement abusif, ill\xe9gal ou dangereux,\n\u2022 de contenus manifestement illicites,\n\u2022 de fraude ou tentative de fraude,\n\u2022 de risque pour la s\xe9curit\xe9 de la Plateforme ou des utilisateurs.\n\n5. Suppression par l\u2019utilisateur\nL\u2019utilisateur peut demander la suppression de son compte selon les modalit\xe9s pr\xe9vues dans la politique de confidentialit\xe9. Certaines donn\xe9es peuvent \xeatre conserv\xe9es pour des obligations l\xe9gales, la s\xe9curit\xe9 ou la gestion des litiges.\n\n6. Notifications\nL\u2019utilisateur peut recevoir des notifications (messages, r\xe9ponses, informations importantes). Il peut les d\xe9sactiver via les r\xe9glages de son appareil ou de l\u2019application, sous r\xe9serve des notifications strictement n\xe9cessaires au fonctionnement et \xe0 la s\xe9curit\xe9.\n","Comptes & s\xe9curit\xe9")},
